import React from 'react'
import { useContext } from 'react'
import './FourDays.css'
import Context from '../../../../helper/Context'
import DaytimeTemperature from '../../../../components/DaytimeTemperature'


export default function FourDays() {

  const fourDaysData = useContext(Context)

  let arrFour = []

  if(fourDaysData.weatherSixteenDays){
    arrFour = fourDaysData.weatherSixteenDays.slice(0, 12)
  }

  return (
    <div className='four-days'>
      {arrFour.map(item => <DaytimeTemperature date={item.valid_date} image={item.weather.icon} max={item.max_temp} min={item.min_temp} description={item.weather.description} />)}
    </div>
  )
}
